package com.amandris.clients.service.vo;import java.io.Serializable;import java.util.Date;public class SellerMessage implements Serializable{	private Integer id;	private Integer sellerId;	private String 	sender;	private Integer active;	private String 	subject;	private String  text;	private Integer isHtml;	private Integer isNew;	private Date 	date;	private Seller 	seller;		private static final long serialVersionUID = 6526471155622776016L;			public Date getDate() {		return date;	}	public void setDate(Date date) {		this.date = date;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Integer getIsHtml() {		return isHtml;	}	public void setIsHtml(Integer isHtml) {		this.isHtml = isHtml;	}	public Integer getIsNew() {		return isNew;	}	public void setIsNew(Integer isNew) {		this.isNew = isNew;	}	public Seller getSeller() {		return seller;	}	public void setSeller(Seller seller) {		this.seller = seller;	}	public Integer getSellerId() {		return sellerId;	}	public void setSellerId(Integer sellerId) {		this.sellerId = sellerId;	}	public String getSender() {		return sender;	}	public void setSender(String sender) {		this.sender = sender;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}	public Integer getActive() {		return active;	}	public void setActive(Integer active) {		this.active = active;	}	public String getSubject() {		return subject;	}	public void setSubject(String subject) {		this.subject = subject;	}		}